import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  console.log('This is the TileList component')

  return (
    <div>
      {props.tile.map((tile, index) => (
        <Tile
          key={index}
          tile={tile.name}
          description={{ ...tile, name: undefined}}
          className="tile-container"
        />
      ))}
    </div>
  );
};
